window.bookSummaryJSON = "<p><b>The fourth book in the </b><b><i>Wall Street Journal</i></b><b> best-selling Leveling Up series.</b></p> <p>The Ivy House team is shaping up, but there are still holes to be filled and a magical summons outstanding. Jessie needs a teacher. Someone who can fit in with the whacky Ivy House crew. And that was going just fine...until she gets a request to host a powerful, neighboring mage. </p> <p>A teacher isn't going to be enough. She needs more power in her crew. She needs some might. </p> <p>This time, Austin Steele might not be able to dominate what she calls in, creatures no shifter has ever dominated before.</p> <p>But that isn't all Austin has to worry about. After a skirmish in the bar, suddenly his whole world is turned upside down. He can no longer ignore the feelings that have been growing for Jess.</p> <p>He also can't ignore the town's complete lack of readiness for the neighboring mage's visit. He must call in his brother to help lock down the town. And when his brother arrives, he must finally hash out the past that has split them apart so that he can claim his future. </p>"; 
